To design an end-user API for 3D camera animation in TypeScript, follow these steps:

1. Define the camera class:
```
export class Camera {
  public position: Vector3;
  public rotation: Quaternion;
  public zoom: number;

  constructor(position: Vector3, rotation: Quaternion, zoom: number) {
    this.position = position;
    this.rotation = rotation;
    this.zoom = zoom;
  }
}
```
This class defines the properties of the camera, including its position, rotation, and zoom level.

2. Define the animation class:
```
export class Animation {
  public camera: Camera;
  public startPosition: Vector3;
  public startRotation: Quaternion;
  public startZoom: number;
  public endPosition: Vector3;
  public endRotation: Quaternion;
  public endZoom: number;
  public duration: number;

  constructor(camera: Camera, startPosition: Vector3, startRotation: Quaternion, startZoom: number, endPosition: Vector3, endRotation: Quaternion, endZoom: number, duration: number) {
    this.camera = camera;
    this.startPosition = startPosition;
    this.startRotation = startRotation;
    this.startZoom = startZoom;
    this.endPosition = endPosition;
    this.endRotation = endRotation;
    this.endZoom = endZoom;
    this.duration = duration;
  }
}
```
This class defines the animation, including its camera, start and end positions and rotations, start and end zoom levels, and duration.

3. Define the animation API:
```
export class AnimationAPI {
  public startAnimation(animation: Animation): void {
    this.camera.position = this.camera.position.add(animation.startPosition);
    this.camera.rotation = this.camera.rotation.multiply(animation.startRotation);
    this.camera.zoom = animation.startZoom;

    const positionDifference = animation.endPosition.subtract(animation.startPosition);
    const rotationDifference = animation.endRotation.multiply(this.camera.rotation.inverse());
    const zoomDifference = animation.endZoom - animation.startZoom;

    let position = this.camera.position;
    let rotation = this.camera.rotation;
    let zoom = this.camera.zoom;

    requestAnimationFrame(() => {
      this.animate(position, rotation, zoom, positionDifference, rotationDifference, zoomDifference);
    });
  }

  private animate(position: Vector3, rotation: Quaternion, zoom: number, positionDifference: Vector3, rotationDifference: Quaternion, zoomDifference: number): void {
    position = position.add(positionDifference.multiply(Math.min(1, (AnimationAPI.currentTime - AnimationAPI.startTime) / AnimationAPI.duration)));
    rotation = rotation.multiply(rotationDifference.multiply(Math.min(1, (AnimationAPI.currentTime - AnimationAPI.startTime) / AnimationAPI.duration)));
    zoom = Math.min(1, (AnimationAPI.currentTime - AnimationAPI.startTime) / AnimationAPI.duration) * zoomDifference + animation.startZoom;

    this.camera.position = position;
    this.camera.rotation = rotation;
    this.camera.zoom = zoom;

    if (AnimationAPI.currentTime < AnimationAPI.duration) {
      requestAnimationFrame(() => {
        this.animate(position, rotation, zoom, positionDifference, rotationDifference, zoomDifference);
      });
    } else {
      AnimationAPI.currentTime = 0;
      this.camera.position = this.camera.position.add(animation.endPosition);
      this.camera.rotation = this.camera.rotation.multiply(animation.endRotation);
      this.camera.zoom = animation.endZoom;
    }
  }
}
```
This class defines the API for starting and animating an animation. It includes a `startAnimation` method that sets the camera's position, rotation, and zoom to their start values and starts the animation. The `animate` method updates the camera's position, rotation, and zoom based on the animation's start and end values and the current time. It also updates the animation's duration and current time.

4. Use the API:
```
const camera = new Camera(new Vector3(0, 0, 0), new Quaternion(), 1);
const startPosition = new Vector3(0, 0, -10);
const startRotation = new Quaternion(Math.PI / 2, 0, 0, 0);
const startZoom = 0.1;
const endPosition = new Vector3(0, 0, 0);
const endRotation = new Quaternion();
const endZoom = 1;
const duration = 2;

const animation = new Animation(camera, startPosition, startRotation, startZoom, endPosition, endRotation, endZoom, duration);

AnimationAPI.startTime = performance.now();
AnimationAPI.currentTime = 0;
AnimationAPI.startAnimation(animation);
```
This code creates a camera and an animation, defines its start and end values, and starts the animation using the `startAnimation` method.

In summary, to design an end-user API for 3D camera animation in TypeScript, define the camera and animation classes, define the animation API, and use the API to start and animate the camera.

