import 'dart:convert';

class Transaction {
  final String coinName;
  final DateTime dateTime;
  final double profitOrLoss;

  Transaction(this.coinName, this.dateTime, this.profitOrLoss);

  Map<String, dynamic> toMap() {
    return {
      'coinName': coinName,
      'dateTime': dateTime.toIso8601String(),
      'profitOrLoss': profitOrLoss,
    };
  }

  factory Transaction.fromMap(Map<String, dynamic> map) {
    return Transaction(
      map['coinName'],
      DateTime.parse(map['dateTime']),
      map['profitOrLoss'],
    );
  }
}

class Coin {
  final String name;
  final List<Transaction> transactions;
  double averageProfit = 0;
  double averageLoss = 0;

  Coin(this.name, this.transactions);

  void calculateAverages() {
    var profits = transactions.where((t) => t.profitOrLoss > 0).map((t) => t.profitOrLoss).toList();
    var losses = transactions.where((t) => t.profitOrLoss < 0).map((t) => t.profitOrLoss).toList();
    averageProfit = profits.length == 0 ? 0 : profits.reduce((a, b) => a + b) / profits.length;
    averageLoss = losses.length == 0 ? 0 : losses.reduce((a, b) => a + b) / losses.length;
  }

  String toJson() {
    return json.encode({
      'name': name,
      'transactions': transactions.map((t) => t.toMap()).toList(),
      'averageProfit': averageProfit,
      'averageLoss': averageLoss,
    });
  }

  factory Coin.fromJson(String json) {
    return Coin(
      json['name'],
      (json['transactions'] as List)
          .map((m) => Transaction.fromMap(m))
          .toList(),
    );
  }
}

void main() {
  var transactions = [
    Transaction('BTC', DateTime.parse('2021-01-01'), 100),
    Transaction('ETH', DateTime.parse('2021-01-02'), 50),
    Transaction('ETH', DateTime.parse('2021-01-03'), -25),
    Transaction('BTC', DateTime.parse('2021-01-04'), 75),
    Transaction('LTC', DateTime.parse('2021-01-05'), 10),
    Transaction('BTC', DateTime.parse('2021-01-06'), 150),
    Transaction('ETH', DateTime.parse('2021-01-07'), -50),
    Transaction('LTC', DateTime.parse('2021-01-08'), -10),
    Transaction('BTC', DateTime.parse('2021-01-09'), 200),
    Transaction('ETH', DateTime.parse('2021-01-10'), 125),
  ];

  var coins = <Coin>[];
  var sortedTransactions = transactions.toList();
  sortedTransactions.sort((a, b) => b.profitOrLoss.compareTo(a.profitOrLoss));
  for (var I = 0; I < sortedTransactions.length; i++) {
    var coin = sortedTransactions[i].coinName;
    var index = coins.indexWhere((c) => c.name == coin, orElse: () => -1);
    if (index == -1) {
      coins.add(Coin(coin, [sortedTransactions[i]]));
    } else {
      coins[index].transactions.add(sortedTransactions[i]);
    }
  }
  for (var c in coins) {
    c.calculateAverages();
  }

  var highAverageProfit = coins.where((c) => c.averageProfit > 0).toList();
  var highAverageLoss = coins.where((c) => c.averageLoss < 0).toList();

  print('Top 3 coins with highest average profit:');
  for (var c in highAverageProfit.take(3)) {
    print('${c.name}: average profit = ${c.averageProfit.toStringAsFixed(2)}');
  }

  print('Top 3 coins with highest average loss:');
  for (var c in highAverageLoss.take(3)) {
    print('${c.name}: average loss = ${c.averageLoss.toStringAsFixed(2)}');
  }
}
```

In this code, we first create a list of `Transaction` objects, each containing the name of the coin, the date and time of the transaction, and the profit or loss earned. We then create a list of `Coin` objects, where each coin is represented by its name and a list of transactions. We calculate the average profit and average loss for each coin by iterating over its transactions and summing up the profits and losses, respectively. We then sort the list of coins by their average profit in descending order using a lambda function that compares the profitOrLoss of each transaction. We then iterate over the sorted list of coins and add each transaction to the appropriate coin object. We then calculate the average profit and average loss for each coin object. Finally, we find the top 3 coins with the highest average profit and the top 3 coins with the highest average loss and print their names and average profit/loss.

