import java.util.Arrays;
import java.util.List;
import java.util.Map;
import java.util.TreeMap;
import java.util.stream.Collectors;
import org.apache.commons.math3.util.Precision;

public class MagneticFieldAnalyzer {
    public static void main(String[] args) {
        // Read data table from Excel file or other data source
        String[][] data = {
            {"A", "20.5", "50.2", "0.22"},
            {"B", "40.2", "60.7", "0.18"},
            {"C", "10.1", "70.5", "0.25"},
            {"D", "30.7", "80.1", "0.19"},
            {"E", "50.6", "90.8", "0.21"}
        };

        // Calculate magnetic field intensity in nT
        List<Map<String, Double>> dataList = Arrays.stream(data)
            .map(row -> {
                double magneticFieldIntensityInTesla = Double.parseDouble(row[3]);
                double magneticFieldIntensityInnT = magneticFieldIntensityInTesla * 1000000;
                return Map.of("Location", row[0], "Latitude", Double.parseDouble(row[1]), "Longitude", Double.parseDouble(row[2]), "Magnetic Field Intensity (nT)", magneticFieldIntensityInnT, "Magnetic Field Intensity (T)", magneticFieldIntensityInTesla);
            }).collect(Collectors.toList());

        // Sort data by magnetic field intensity in nT
        Map<String, Double> sortedData = new TreeMap<>(dataList);

        // Identify location with highest magnetic field intensity
        String highestLocation = sortedData.firstEntry().getKey();
        double highestMagneticFieldIntensityInnT = sortedData.firstEntry().getValue();

        // Calculate distance to highest magnetic field intensity
        double distanceToHighestInMeters = 100000; // assumed distance between device and highest magnetic field intensity

        // Calculate energy generated
        double energyGeneratedInJoules = highestMagneticFieldIntensityInnT * distanceToHighestInMeters * distanceToHighestInMeters * Math.PI * Math.PI / 2;

        // Calculate usable electricity
        double usableElectricityInWatts = energyGeneratedInJoules / Precision.round(energyGeneratedInJoules, 3);

        // Store usable electricity
        Map<String, Double> usableElectricity = new TreeMap<>(Map.of("Location", highestLocation, "Usable Electricity (Watts)", usableElectricityInWatts));

        // Display usable electricity
        System.out.println(usableElectricity);
    }
}
```

